import React from 'react';
import bubble from './bubble.PNG'
const Home=()=>{
    return(
        <>
            <h1><center>V  I  S  A  L</center></h1>
            <pre><center>Algorithm visualization platform</center></pre><br/>
            <div>
                <a href="/Bubblesort">
                    <img className='image-responsive' src={bubble} Style='height:150px;width:250px;'/>
                </a>
                
            </div>
        </>
    );
}
export default Home;
